class Midi {

	constructor(startAction) {
		this.embeddedSongs = [
			// Granados - Oriental
				'data:audio/midi;base64,',
			// Joplin - The Entertainer
				'data:audio/midi;base64,',
			// Tchaikovsky - Arabian Dance
				'data:audio/midi;base64,',
			// Tchaikovsky - Waltz of the Flowers
				'data:audio/midi;base64,',
		];

		this.player=null;
		this.urlData=false;
		this.justIntonation=false;
		this.currentMidiPosition=0;
		this.transposition=0; // semitones

		eventjs.add(window, "load", function(event) {


			MIDI.loader = new sketch.ui.Timer;
			MIDI.loadPlugin({
				soundfontUrl: "soundfont/",
				onprogress: function(state, progress) {
					MIDI.loader.setValue(progress * 100);
				},
				onsuccess: function() {
					/// this is the language we are running in
					console.log("MIDI API: " + MIDI.api + " " + JSON.stringify(MIDI.supports));

					theMidi.player=MIDI.Player;
					theMidi.player.timeWarp = 1; // default speed
					theMidi.progressBar(theMidi.player);

					// register note even listener
					theMidi.player.addListener(theMidi.onEvent);

					if (typeof startAction!="undefined") startAction();
				}
			});
		});
	}

	getTags() {
		// get the html tgas for the midi area and for the corresponding control area
		if (typeof this.tag == "undefined") {
			this.tag=$("#lilymidi");
			this.controlTag=$("#midiControl");
		}
	}

	show() {
		// show the blue wave area
		this.getTags();
		if (this.tag.is(":visible")) return;
		this.tag.show();
		this.controlTag.show();
	}

	hide() {
		// hide the blue wave area
		this.getTags();
		if (!this.tag.is(":visible")) return;
		this.tag.hide();
		this.controlTag.hide();
	}

	toggle() {
		// show/hide the blue wave area
		this.getTags();
		if (this.tag.is(":visible"))	this.hide();
		else							this.show();
	}

	// -------------------------------------------------------
	onEvent(data) {
		theStaff.drawNote(data);
		theMidi.showEvent(JSON.stringify(data));
		theMidi.playPosition(data);
	}

	// -------------------------------------------------------
	showEvent(txt) {
		$("#midiEvents").append(txt+"<br/>");
	}

	// -------------------------------------------------------
	clearEvents() {
		$("#midiEvents").html("");
	}

	// -------------------------------------------------------
	loadLyScore(name) {
		$.get("score/"+name+".ly", function( ly ) {
			$("#lyScore").text(ly);
		});
		$("#pdfScoreMidi").attr("src","score/"+name+".pdf");
	}

	// -------------------------------------------------------
	timeFormatting(n) {
		var minutes = n / 60 >> 0;
		var seconds = String(n - (minutes * 60) >> 0);
		if (seconds.length == 1) seconds = "0" + seconds;
		return minutes + ":" + seconds;
	}

	// -------------------------------------------------------
	loadMidi64(name) {
		this.currentMidiTime = 0;
		$.get("score/"+name+".mid64", function( data ) {
			theMidi.loadUrlData(data);
		});
	}

	// -------------------------------------------------------
	loadMidi(name) {
		if (name.slice(-2)=="..") return;
		this.loadLyScore(name);
		theMidi.loadUrlData("score/"+name+".mid");
	}

	// -------------------------------------------------------
	loadUrlData(data) {
		this.urlData=data;
		this.player.loadFile(data, this.onLoaded);
	}

	// -------------------------------------------------------
	onLoaded() {
		var that=theMidi;
		$("#midiEvents").html("");
		// start player (restart from current position)
		MIDI.Player.currentTime=MIDI.Player.endTime*that.currentMidiPosition;
	    that.player.start(function() {}, function(event,time) {that.onQueue(event,time)});

		$("#time2").html(that.timeFormatting(that.player.endTime /1000));
		that.showEvent("instruments="+JSON.stringify(theMidi.player.getFileInstruments())+" BPM="+that.player.BPM);
		theStaff.drawStaff();
		// setTimeout(function() { that.pausePlayStop(); }, 2000);
	}


	// -------------------------------------------------------
	reloadMidi() {
		this.currentMidiPosition = 0;
		if (MIDI.Player.endTime>0) {
			this.currentMidiPosition = (MIDI.Player.currentTime -100) / MIDI.Player.endTime;
			if (this.currentMidiPosition<0 || this.currentMidiPosition>=0.95) this.currentMidiPosition=0;
		}
		if (this.urlData) this.player.loadFile(this.urlData, this.onLoaded);
	}

	// -------------------------------------------------------
	onQueue(event,time) {
		// mute tracks
		// if (event.channel!=3 && time>2400) event.velocity=0;

		// transpose
		event.noteNumber += this.transposition;


		if (!this.justIntonation || event.subtype!="noteOn") return;
		switch (event.noteNumber%12) {
			case  0: event.bend=   0; break;
			case  1: event.bend= +12; break;		//  ii
			case  2: event.bend=  +4; break;	  	//  II
			case  3: event.bend= +16; break;		// iii
			case  4: event.bend= -14; break;		// III
			case  5: event.bend=  -2; break;		//  IV
			case  6: event.bend= -10; break;
			case  7: event.bend=  +2; break;		//   V
			case  8: event.bend= +14; break;		//  vi
			case  9: event.bend= -16; break;		//	VI
			case 10: event.bend= +18; break;		// vii
			case 11: event.bend= -12; break;		// VII
		}
		event.bend *= (0.5*0.0010594631);

	}

	// -------------------------------------------------------
	toggleLoopLongNotes() {
		MIDI.loopLongNotes(this.loopLongNotes = !this.loopLongNotes);
		this.reloadMidi();
	}

	// -------------------------------------------------------
	toggleJust() {
		this.justIntonation = !this.justIntonation;
		this.reloadMidi();
	}

	// -------------------------------------------------------
	transpose(semitones) {
		this.transposition= parseInt(semitones);
		this.reloadMidi();
	}

	// -------------------------------------------------------
	loadEmbeddedSong(nr) {
		this.loadUrlData(this.embeddedSongs[nr]);
		this.loadLyScore("basicChange");
	}

	// -------------------------------------------------------
	loadFile() {
		var file = document.querySelector('input[type=file]').files[0];
		if (file) {
			var reader  = new FileReader();
			reader.readAsDataURL(file);
			reader.addEventListener("load", function () { theMidi.loadUrlData(reader.result); }, false);
		}
	}

	// -------------------------------------------------------
	calcTempo(val) {
		var tempo=parseInt(val);
		if 		(tempo==0) return 100;
		else if (tempo>0 ) return 100 * (1+tempo/5.);
		else if (tempo<0 ) return Math.round(100 / (1-tempo/5.));
	}

	// -------------------------------------------------------
	setTempo(val) {
		this.player.timeWarp = 100./ this.calcTempo(val);
		this.reloadMidi();
	}

	// -------------------------------------------------------
	pausePlayStop(stop) {
		// toggle between Pause and Play modes.
		var d = $("#pausePlayStop")[0];
		if (stop) {
			theMidi.player.stop();
			d.src = "img/play.png";
			theMidi.playPosition({now:0,end:theMidi.player.endTime})
		} else if (theMidi.player.playing) {
			d.src = "img/play.png";
			theMidi.player.pause(true);
		} else {
			d.src = "img/pause.png";
			theMidi.playPosition({now:theMidi.player.currentTime,end:theMidi.player.endTime});
			theMidi.clearEvents();
			theMidi.player.resume(function() {}, function(event,time) {theMidi.onQueue(event,time)});
		}
	};

	// -------------------------------------------------------
	playPosition(data) {
		var percent = data.now / data.end;
		var now = data.now/1000. >> 0; // where we are now
		$("#cursor").css("width",(percent * 100) + "%");
		$("#time1").html(theMidi.timeFormatting(now));
	}

	// -------------------------------------------------------
	progressBar(player) {

		// register function to change player time if user drags the play bar

		var capsule = document.getElementById("capsule");
		eventjs.add(capsule, "drag", function(event, self) {
			eventjs.cancel(event);
			player.currentTime = (self.x) / self.bbox.width * player.endTime;
			if (player.currentTime < 0) player.currentTime = 0;
			if (player.currentTime > player.endTime) player.currentTime = player.endTime;
			if 		(self.state === "down") {
				theMidi.playPosition({now:player.currentTime,end:player.endTime});
				theMidi.wasPlaying = player.playing;
				player.pause(true);
			}
			else if (self.state === "up") {
				theMidi.pausePlayStop();
				if (!theMidi.wasPlaying) {
					setTimeout(theMidi.pausePlayStop,100);
				}
			}
		});

	};
}

// create Midi instance and trigger initial action
var theMidi = new Midi(
	function () {
		// theMidi.loadMidi('Basic Change');
	}
);
